// import React from "react";

// function Heading() {
//   return <h1> My name is ANR</h1>;
// }

function add(a, b) {
  return a + b;
}

function sub(a, b) {
  return a - b;
}

function div(a, b) {
  return a / b;
}

function mul(a, b) {
  return a * b;
}
export default Heading;
